import logo from "./logo.svg";
import "./App.css";

function App() {
  return (
    <>
      <div className="App">
        <header className="App-header">
          <h2>Streamline your studies go digital with Athena</h2>
          <p>
            We give students a new way to study. Digitally. Find your
            e-coursebooks, documents, and past-exams all in one place. Cheaper
            than physical books. Smarter than physcial books.
          </p>
        </header>
      </div>
      <div className="Image">
        <h2>Här kommer bilden på datorn</h2>
        <img />
      </div>
    </>
  );
}

export default App;
